import {Media} from 'reactstrap';


function renderLeader(props){
    const lead = props.leaders_arr_obj.map( (leader) => {
        return(
            <div className="mb-2">
            <Media>

            </Media>
        </div>
        );
    });
    return lead;
}
export default renderLeader;
